import React, { useState } from "react";
import axios from "axios";

function App() {
  const [jdFile, setJdFile] = useState(null);
  const [resumes, setResumes] = useState([]);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");
    setResults([]);

    const formData = new FormData();
    formData.append("jd", jdFile);
    resumes.forEach((file) => formData.append("resumes", file));

    try {
      const response = await axios.post("http://localhost:8000/analyze/", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      console.log("Response:", response.data);
      setResults(response.data.results || []);
    } catch (err) {
      console.error(err);
      setError("Failed to analyze resumes. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      style={{
        maxWidth: "800px",
        margin: "50px auto",
        padding: "20px",
        border: "1px solid #ccc",
        borderRadius: "12px",
        boxShadow: "0px 2px 6px rgba(0,0,0,0.1)",
        fontFamily: "Arial, sans-serif",
      }}
    >
      <h1 style={{ textAlign: "center", color: "#2c3e50" }}>AI Resume Screening</h1>

      <form onSubmit={handleSubmit} style={{ marginTop: "20px" }}>
        <div style={{ marginBottom: "15px" }}>
          <label style={{ display: "block", fontWeight: "bold" }}>Job Description:</label>
          <input type="file" onChange={(e) => setJdFile(e.target.files[0])} required />
        </div>

        <div style={{ marginBottom: "15px" }}>
          <label style={{ display: "block", fontWeight: "bold" }}>Resumes:</label>
          <input type="file" multiple onChange={(e) => setResumes([...e.target.files])} required />
        </div>

        <button
          type="submit"
          style={{
            backgroundColor: "#3498db",
            color: "white",
            padding: "10px 20px",
            border: "none",
            borderRadius: "8px",
            cursor: "pointer",
          }}
          disabled={loading}
        >
          {loading ? "Analyzing..." : "Analyze"}
        </button>
      </form>

      {error && <p style={{ color: "red", marginTop: "15px" }}>{error}</p>}

      {!loading && results && results.length > 0 && (
        <div style={{ marginTop: "30px" }}>
          <h2 style={{ color: "#2c3e50" }}>Results</h2>
          <table
            style={{
              width: "100%",
              borderCollapse: "collapse",
              marginTop: "10px",
            }}
          >
            <thead>
              <tr style={{ backgroundColor: "#f2f2f2" }}>
                <th style={{ border: "1px solid #ddd", padding: "8px" }}>Name</th>
                <th style={{ border: "1px solid #ddd", padding: "8px" }}>Match %</th>
                <th style={{ border: "1px solid #ddd", padding: "8px" }}>Strengths</th>
                <th style={{ border: "1px solid #ddd", padding: "8px" }}>Weaknesses</th>
              </tr>
            </thead>
            <tbody>
              {results.map((r, i) => (
                <tr key={i}>
                  <td style={{ border: "1px solid #ddd", padding: "8px" }}>{r.Name}</td>
                  <td style={{ border: "1px solid #ddd", padding: "8px" }}>{r.match_score}</td>
                  <td style={{ border: "1px solid #ddd", padding: "8px" }}>{r.strengths}</td>
                  <td style={{ border: "1px solid #ddd", padding: "8px" }}>{r.weaknesses}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {!loading && results && results.length === 0 && !error && (
        <p style={{ marginTop: "15px", color: "#777" }}>No results yet. Upload files and click Analyze.</p>
      )}
    </div>
  );
}

export default App;
